  bar.append("rect")

      .attr("height", h-10)
      .transition().delay(function (d,i){ return i * 130;})
      .duration(1000)
      .attr("width", function(d,i){ return (barW/100)*(d.value)});

  bar.append("text")
      .attr("dy", "1em")
    .attr("dx", w-textOffset)
      .attr("class", "label3")
      .text(function(d,i ){return d.skill});

  bar.append("text")
